import React, { setState } from 'react';


function stateFAQ() {
    let showElem = false;
    let Min = () => {
        return (
            <section>
                <div><span>Why is React great?</span><button onClick={showElem = true}>+</button></div>
            </section>
        );
    };
    let Max = () => {
        return (
            <section>
                <div><span>Why is React great?</span><button onClick={showElem = false}>+</button></div>
                <div><span>Fast Learning Curve</span></div>
            </section>
        );
    };
    // let element = setState(<Min />);
    return (
        <div>
            {showElem ? <Max /> : <Min />}
        </div>
    );
}

export default stateFAQ;
